import React from "react";
import styled from "styled-components";
import { Img, Grid, Timer } from "arclight-react";

const Select = styled.div``;

const _Title = styled.div`
  margin-top: 15px;
  & table {
    border-spacing: 20px 0;
  }
`;

const TEMP = () => {
  const arr = [];
  for (let i = 0; i < 150; i++) {
    arr.push(
      <div
        style={{ borderRadius: "4px", overflow: "hidden", cursor: "pointer" }}
      >
        <Img src={require("../img/yone_square.jpg")} width={"100%"} />
      </div>
    );
  }
  return arr;
};

export default class _ extends React.Component {
  render() {
    return (
      <div style={{ width: "inherit", height: "inherit" }}>
        <_Title>
          <table>
            <tbody>
              <tr>
                <td>
                  <Timer
                    theme={this.props.STATE.config.THEME}
                    isPlaying={false}
                    size={75}
                    seconds={60}
                    crit={7}
                    strokeWidth={3}
                    onComplete={() => console.log("Timer Finished")}
                  />
                </td>
                <td>
                  <h1>
                    <b>
                      <i>Ban Phase</i>
                    </b>
                  </h1>
                </td>
              </tr>
            </tbody>
          </table>
        </_Title>
        <Grid
          theme={"Dark"}
          search={true}
          itemsPerRow={10}
          height={"calc(100% - 550px)"}
          filtersRight
          filters={[
            {
              display: <Img src={require("../img/Position_Gold-Top.png")} />,
              active: true,
              onClick: (filter) => console.log(filter.active),
            },
            {
              display: <Img src={require("../img/Position_Gold-Jungle.png")} />,
              active: true,
              onClick: (filter) => console.log(filter.active),
            },
            {
              display: <Img src={require("../img/Position_Gold-Mid.png")} />,
              active: true,
              onClick: (filter) => console.log(filter.active),
            },
            {
              display: <Img src={require("../img/Position_Gold-Bot.png")} />,
              active: true,
              onClick: (filter) => console.log(filter.active),
            },
            {
              display: (
                <Img src={require("../img/Position_Gold-Support.png")} />
              ),
              active: true,
              onClick: (filter) => console.log(filter.active),
            },
          ]}
          items={TEMP()}
        />
      </div>
    );
  }
}
